PLOT: 
&quot;Girls&quot; is about three very different young women who have nonetheless been inseparable best friends from school. Hei, the &quot;proper&quot; one, looks forward to a perfect married life with her perfect fiance Lin. High flyer Kimmy works hard at her career and equally hard at playing with men. May, the &quot;cool&quot; one, is an assistant film director who dreams of directing her own films one day.              

